import React from 'react';

import './Caption.css';

const Caption = (props) => (
    <div className={props.side}>
    {props.right}
      <h3 className="captionHeader">{props.header}</h3>
      <p className="captionText">{props.text}</p>
    </div>
);


export default Caption;
